import React from 'react';
import { NavLink } from 'react-router-dom';

const Map=() =>{
    return(
        <>

<div class="mapouter">
<div class="gmap_canvas">
<iframe width="600" height="500" id="gmap_canvas" 
src="https://maps.google.com/maps?q=Vinayaka%20Nagar,%204th%20cross,%20shimoga%20577201&t=&z=13&ie=UTF8&iwloc=&output=embed" frameborder="0" scrolling="no" marginheight="0" marginwidth="0"></iframe>
<NavLink>=https://123movies-to.org/%22%3E</NavLink><br/>
<style>.mapouter{{position:"relative",textAlign:"right",height:"500px",width:"600px"}}</style>
<NavLink>="https://www.embedgooglemap.net/%22%3E"how do i add a google map to my website</NavLink>
<style>.gmap_canvas {{overflow:"hidden",background:"none!important",height:"500px",width:"600px"}}</style>
</div>
</div>
</>
    );
};
export default Map;
